import React, { Component } from 'react'
import Layout from '../components/Layout';
import Perk from '../components/Perk';

import '../style/perktree.scss';

export default class perktree extends Component {

    constructor(props) {
        super(props);

        this.state = ({
            perkLevelList: []
        })
    }

    updatePerkLevelList(perkLevel) {
        perkLevelList.push( perkLevel)
    }

    checkPerkLevels() {
        console.log("perkLevelList", perkLevelList);

    }


    render() {
        return (
            <Layout>
                <div className="perktree-container">
                    <Perk title={"Strength"} />
                    <Perk title={"Perception"} />
                    <Perk title={"Endurance"} />
                    <Perk title={"Agility"} />
                    <Perk title={"Charisma"} />
                    <Perk title={"Intelligence"} />
                </div>    
                <button onClick={() => this.checkPerkLevels()}></button>
            </Layout>
        )
    }
}
